      * {
        padding: 0;
        margin: 0;
      }

      body {
        font-family: 'Graphik', Arial, Tahoma, Verdana, sans-serif;
        font-weight: normal;
        font-style: normal;
        text-align: left;
        height: 100vh;
        width: 100%;
        display: flex;
        flex-direction: column;
        color: #38343F;
      }

      h1 {
        font-weight: bold;
        font-size: 70px;
        line-height: 75px;
      }

      .container {
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        padding: 80px 100px 70px;
        flex: 1 0 0;
      }

      .caption {
        font-size: 40px;
        line-height: 45px;
        white-space: nowrap;
        overflow: hidden;
        text-overflow: ellipsis;
      }

      .logo {
        max-width: 400px;
        max-height: 160px;
        object-fit: contain;
        object-position: left;
      }
    </style>
  </head>
  <body>
    <div class="container">
      <img class="logo" src="${logo}" />
      <h1></h1>
    </div>
  </body>
